import React from "react";

function User(props) {
    return <th>{props.value}</th> // + edit buttons
}

function UsersRow(props) {
    const users = props.users;
    // userIDs
    const usernames = users && users.map(user => user.username.toString());

    return (
        <tr>
            <th>X</th>
            {usernames && usernames.map(username => <User key={username.toString()} value={username}/>)}
            {/*<input type="text" onSubmit={this.handleAddUser}/>*/}
            <th>Expenses</th>
        </tr>
    );
}

export default UsersRow;
